import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom/App';
import AccountAutomationApp from './components/pages/Account-Automation/App';  // Assuming paths
import FraudDetectionApp from './components/pages/Fraud-Detection/App';
import MainApp from './components/pages/Main/';
import Chatbot from './components/Chatbot'; // Import the Chatbot component

function App() {
  return (
    <Router>
      <div>
        <Routes>
          <Route path="/account-automation" element={<AccountAutomationApp />} />
          <Route path="/fraud-detection" element={<FraudDetectionApp />} />
          <Route path="/main" element={<MainApp />} />
        </Routes>
        <Chatbot /> {/* Add the Chatbot component here */}
      </div>
    </Router>
  );
}

export default App;
